import React, {useEffect} from 'react';
import Nav from "../components/main/Nav";
import HotVideoGridListByViewCnt from "../components/video/HotVideoGridListByViewCnt";
import HotVideoGridListByGoodCnt from "../components/video/HotVideoGridListByGoodCnt";
import DefaultVideoGridList from "../components/video/DefaultVideoGridList";
import RecentCommunityPostGridList from "../components/contents/community/RecentCommunityPostGridList";
import {Divider, Typography} from "@material-ui/core";
import StreamingRoomsList from "../components/streaming/StreamingRoomsList";
import StreamingListCarousal from "../components/streaming/StreamingListCarousal";
import Carousel from "nuka-carousel";

const Index = () => {
    useEffect(() => {
        if (localStorage.getItem("token") == null) {
            window.location.href = "http://127.0.0.1:3000/login"
        }
    })


    return (
        <div>
            <Nav />
            <br/>

            <Typography variant="h4" gutterBottom>
                &nbsp;&nbsp;On Live Now!
            </Typography>

            <Carousel>
                <img src="https://via.placeholder.com/400/ffffff/c0392b/&text=slide1" />
                <img src="https://via.placeholder.com/400/ffffff/c0392b/&text=slide2" />
                <img src="https://via.placeholder.com/400/ffffff/c0392b/&text=slide3" />
                <img src="https://via.placeholder.com/400/ffffff/c0392b/&text=slide4" />
                <img src="https://via.placeholder.com/400/ffffff/c0392b/&text=slide5" />
                <img src="https://via.placeholder.com/400/ffffff/c0392b/&text=slide6" />
            </Carousel>
            <hr/>
            <br/>
            <Typography variant="h4" gutterBottom>
                &nbsp;&nbsp;Popular Videos of the Week
            </Typography>
            <HotVideoGridListByGoodCnt />
            <hr/>
            <br/>
            <Typography variant="h4" gutterBottom>
                &nbsp;&nbsp;Highest hits this week
            </Typography>
            <HotVideoGridListByViewCnt />
            <hr/>
            <br/>
            <Typography variant="h4" gutterBottom>
                &nbsp;&nbsp;Community Post
            </Typography>
            <RecentCommunityPostGridList />
            <hr/>
            <br/>
            <DefaultVideoGridList />
            <Divider/>
        </div>
    );
};

export default Index;
